import React from 'react';
import "./Contact.css";

function Contact() {
    return (
        <div className="contact-container">
            <div className="contact-wrapper">
                <h1 className="contact-text">
                    Contact hi@builtbyjavi.com <br>
                    </br> for opportunities to <br>
                    </br> COLLABORATE</h1>
            </div>
            
        </div>
    )
}

export default Contact
